import React, { useState, useEffect } from "react";
import axios from "axios";

function MainPage() {
  const [habits, setHabits] = useState([]);
  const [newHabit, setNewHabit] = useState("");

  const token = localStorage.getItem("token");

  useEffect(() => {
    if (!token) {
      alert("You are not logged in!");
      window.location.href = "/";
    }
  }, [token]);

  const today = new Date();
  const date = today.toLocaleDateString();
  const day = today.toLocaleDateString("en-US", { weekday: "long" });

  const fetchHabits = async () => {
    try {
      const res = await axios.get("http://localhost:5000/api/habits", {
        headers: { Authorization: `Bearer ${token}` },
      });
      setHabits(res.data);
    } catch (err) {
      console.error("Fetch habits error:", err.response || err);
      alert("Failed to fetch habits. Make sure backend is running and token is valid.");
    }
  };

  useEffect(() => { fetchHabits(); }, []);

  const addHabit = async (e) => {
    e.preventDefault();
    if (!newHabit.trim()) return alert("Enter a habit");
    try {
      const res = await axios.post(
        "http://localhost:5000/api/habits",
        { title: newHabit },
        { headers: { Authorization: `Bearer ${token}` } }
      );
      setNewHabit("");
      setHabits([res.data, ...habits]);
    } catch (err) {
      console.error("Add habit error:", err.response || err);
      alert("Failed to add habit. Make sure backend is running and token is valid.");
    }
  };

  const toggleHabit = async (id) => {
    try {
      const res = await axios.put(
        `http://localhost:5000/api/habits/${id}/toggle`,
        {},
        { headers: { Authorization: `Bearer ${token}` } }
      );
      setHabits(habits.map(h => (h._id === id ? res.data : h)));
    } catch (err) {
      console.error("Toggle habit error:", err.response || err);
      alert("Failed to toggle habit");
    }
  };

  return (
    <div style={styles.container}>
      <div style={styles.card}>
        <h1 style={styles.title}>Welcome to your Habit Tracker!</h1>
        <p style={styles.date}>Today is {day}, {date}</p>

        <form onSubmit={addHabit} style={styles.form}>
          <input
            type="text"
            placeholder="Add a new habit"
            value={newHabit}
            onChange={(e) => setNewHabit(e.target.value)}
            style={styles.input}
          />
          <button type="submit" style={styles.button}>Add Habit</button>
        </form>

        <ul style={styles.list}>
          {habits.map(habit => (
            <li key={habit._id} style={styles.listItem}>
              <input
                type="checkbox"
                checked={habit.completed}
                onChange={() => toggleHabit(habit._id)}
                style={styles.checkbox}
              />
              <span style={{ textDecoration: habit.completed ? "line-through" : "none" }}>
                {habit.title}
              </span>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
}

const styles = {
  container: {
    display: "flex",
    justifyContent: "center",
    alignItems: "flex-start",
    minHeight: "100vh",
    backgroundColor: "#f0f4f8",
    paddingTop: "50px"
  },
  card: {
    backgroundColor: "#fff",
    padding: "30px 40px",
    borderRadius: "10px",
    boxShadow: "0 4px 15px rgba(0,0,0,0.1)",
    width: "400px",
    textAlign: "center"
  },
  title: {
    marginBottom: "10px",
    color: "#333"
  },
  date: {
    marginBottom: "20px",
    color: "#666",
    fontSize: "14px"
  },
  form: {
    display: "flex",
    justifyContent: "center",
    marginBottom: "20px"
  },
  input: {
    padding: "10px",
    width: "70%",
    borderRadius: "5px",
    border: "1px solid #ccc",
    marginRight: "10px"
  },
  button: {
    padding: "10px 15px",
    borderRadius: "5px",
    border: "none",
    backgroundColor: "#4CAF50",
    color: "#fff",
    cursor: "pointer"
  },
  list: {
    listStyle: "none",
    padding: 0,
    textAlign: "left"
  },
  listItem: {
    display: "flex",
    alignItems: "center",
    marginBottom: "10px",
    fontSize: "16px"
  },
  checkbox: {
    marginRight: "10px"
  }
};

export default MainPage;
